import React from "react";

import SiteButton from "../UI/SiteButton";
import Header from "../Components/Header";
import Footer from "../Components/Footer";

import "../fonts/fonts.css";
import classes from "./Compose.module.css";
import classes2 from "./Nespresso.module.css";

const Nespresso = () => {
  return (
    <div className={classes.wrap}>
      <Header bgColor=" " titleColor="#ffffff" />

      <div
        className={classes2.subPageBanner}
        style={{ background: "url(images/sub_nespresso_banner.png)" }}
      >
        <div className={classes2.subBannerText}>
          <div className={classes2.subBannerTextLeft}>
            <p>작업기간</p>
            <p>기여도</p>
            <p>사용 프로그램</p>
          </div>
          <div className={classes2.subBannerTextRight}>
            <p>2022.04 ~ 2022.05</p>
            <p>100%</p>
            <div className={classes2.subBannerTools}>
              <p
                style={{
                  background: "url(images/icon_photoshop.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_illustrator.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_xd.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_html5.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_css3.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
              <p
                style={{
                  background: "url(images/icon_javascript.png) no-repeat",
                  backgroundSize: "100%",
                }}
              ></p>
            </div>
          </div>
        </div>
        <SiteButton
          className={classes.composeBtn}
          btnColor="#d3391a"
          textColor="#ffffff"
          top="775px"
          left="370px"
          link="nespresso/index.html"
        />
      </div>

      <section className={classes2.subInfo} style={{ background: "#333333" }}>
        <div className={classes2.infoTitle} style={{ magin: "0 auto" }}>
          <div
            className={classes2.infoLogo}
            style={{
              width: "218px",
              height: "45px",
              background: "url(images/logo_nespresso.png)",
            }}
          ></div>
          <p style={{ textAlign: "center" }}>
            네스프레소는 1980년대 유럽시장에서 처음 소개된 '네슬레'의 캡슐커피
            브랜드입니다.
            <br />
            현재 캡슐의 특허가 만료되어 다양한 브랜드에서 호환캡슐이 출시되고
            있습니다.
          </p>
        </div>

        <div className={classes2.subCategori}>
          <p>POINT</p>
          <p>
            한국소비자원에 따르면 네스프레소는 캡슐커피 시장에서 58%의 점유율을
            가지고 있으며 소비자들은 편리함 때문에
            <br />
            캡슐커피를 선택했으며 브랜드를 선택함에 있어 맛을 가장 중요하게
            생각합니다.
            <br />
            그리고 캡슐 호환 문제가 가장 큰 불만이라고 말하고 있습니다.
          </p>
        </div>
      </section>

      <SiteButton
        className={classes.composeBtn}
        btnColor="#d3391a"
        textColor="#ffffff"
        width="452px"
        top="12100px"
        left="50%"
        link="nespresso/index.html"
        transX="-50%"
      />

      <Footer footerTop="12267px" />
      {/* <img src="images/nespresso.png" alt="네스프레소" /> */}
    </div>
  );
};

export default Nespresso;
